import React from 'react';
import { themeBg, themesContainer } from './ThemeElements';

function Themes() {
    return (
        <themesContainer>
            <themeBg>
                <VideoBg autoPlay loop muted src= {video} type='map/mp4' />
            </themeBg>
        </themesContainer>
    );
};

export default Themes
